description:{"ja":"エルフと同棲生活、始めます!!?

仕事もなく人生ドン底の青年・織部栄一（おりべえいいち）はある日、公園で謎の石を拾うと突如発光!?目を開けるとそこは巨大な樹の上でエルフの美女を抱きかかえていた！衰弱している彼女を助けようとする栄一、だが樹から落下し意識を失ってしまう。

しばらくして病院で目を覚ますと、そこには公安を名乗る黒川とエルフのティアの姿が。そこで告げられたのは衝撃の事実…そして、ティアからの突然の告白!!果たして栄一の運命は…!!?"}

